import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image } from 'react-native';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';


const Home = () => {
    return (
        <Card style={style.mycard}>
            <View style={style.cardview}>
            <Image
                style={{ width: 60, height: 60, borderRadius: 60 / 2 }}
                source={{ uri: "https://images.unsplash.com/photo-1488426862026-3ee34a7d66df?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8bGFkeXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60" }}

            />
            <View>
                
            </View>
            <Text style={style.text}>hello from home</Text>
            </View>
           
        </Card>

    )
}

const style = StyleSheet.create({
    mycard: {
        margin: 5,
        backgroundColor: '#fff',
        padding:5 ,
   

    },
    cardview:{
       flexDirection:'row'
    },
    text:{
        fontSize:12,

    }
})

export default Home;
